import Header from './component/Header';
import Banner from './component/Banner';
import reducers from './reducer/index'
export const store = createStore(
  reducers,
);
class App extends Component{ 
  render(){ 
    return (
      <Fragment>
        <StyleRoot>
          <Header />
          <Banner />
          <ProductList />
        </StyleRoot>
      </Fragment>
    );
  }
}
export default App;
